const INITIAL_STATE = {
  logs: [],
};

const logsReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case "UPDATE_LOGS": {
      return { ...state, logs: [...state.logs, action.payload.newlog] };
    }

    default: {
      return state;
    }
  }
};

export default logsReducer;
